css:
.workspace .horizontal .vertical {
  position: relative;
}
ul.background-tips {
  -webkit-user-select: none;
  cursor: default;
}
ul.background-tips li {
  padding: 0 30px;
}
ul.background-tips li .keystroke {
  border: 2px solid;
  padding: 0 5px;
  border-radius: 6px;
  font-family: Helvetica, Arial, sans-serif;
}
